import React from 'react';

function Product({ product }) {
    return (
        <article className="catalog-body__item product">
            <img src="img/product1.jpg" alt="" />
            <p>{product.name}</p>
            <h4>{product.price} MDL</h4>
        </article>
    );
}

export default Product;
